import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import {
  Box,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Typography,
  Button,
} from "@mui/material";

const CarListPage = () => {
  const [cars, setCars] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    axios
      .get("http://localhost:3030/api/car/main") // 12 araba bu endpointten
      .then((res) => setCars(res.data))
      .catch((err) => console.error("Failed to fetch cars", err));
  }, []);

  const handleViewDetails = (id) => {
    navigate(`/car/${id}`);
  };

  return (
    <Box p={4}>
      <Typography variant="h4" gutterBottom fontWeight="bold">
        Featured Cars
      </Typography>

      <Grid container spacing={3}>
        {cars.map((car) => (
          <Grid item xs={12} sm={6} md={4} key={car.id}>
            <Card>
              {car.images && car.images.length > 0 && (
                <CardMedia
                  component="img"
                  height="200"
                  image={`data:image/jpeg;base64,${car.images[0].imageBase64}`}
                  alt={`${car.brand} ${car.model}`}
                />
              )}
              <CardContent>
                <Typography variant="h6">
                  {car.brand} {car.model}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {car.fuel} • {car.year} • {car.km} km
                </Typography>
                <Typography variant="body1" color="text.primary" sx={{ mt: 1 }}>
                  {car.price} ₺
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  İletişim: {car.contact}
                </Typography>
              </CardContent>
              <Button
                onClick={() => handleViewDetails(car.id)}
                variant="contained"
                fullWidth
                sx={{ backgroundColor: "#5c2e2e", borderRadius: 0 }}
              >
                View Details
              </Button>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default CarListPage;
